import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import { series } from "./seriesInfo";

function ncard(val) {
  console.log(val);

  return (
    <Card
      imgsrc={val.image}
      title={val.title}
      Sname={val.Sname}
      link={val.link}
    />
  );

}

ReactDOM.render(
  <>
    <div className="heading">Best Series on Netflix and Amazon</div>
    <div className="cardContainer">
    {series.map(ncard)}

    </div>
  </>,
  document.getElementById("root")
);
